import React from 'react';
import '../styles/textarea.css';

const e = React.createElement;

class Console extends React.Component{

    constructor(props){
        super(props)
    }
    componentDidMount(){
        console.log(this.props);
    }

    render(){
        return e(
            'textarea',
            {
                className:'console',
            },
            this.props.console
        )
    }


}

export default Console;
